import "./Login.css"
import Switch from "react-switch"
import { useState } from "react";

function Login({user}) {

  
        // Utiliser useState pour gérer l'état du bouton switch
        const [isLogged, setIsLogged] = useState(true);
      
        // Fonction pour changer l'état du bouton switch
        const handleSwitchChange = (checked) => {
          setIsLogged(checked);
        };

    

    return(

        <div className="loginComponent">
        <div className="switchFrame">
        <p className="switchValue" style={{ color: isLogged ? "#000000" : "forestgreen" }}>Login</p>
        <Switch onChange={handleSwitchChange} checked={isLogged} uncheckedIcon={false} checkedIcon={false}  onHandleColor="#228B22"
          onColor="#d3d3d3"
          offHandleColor="#228B22"
          offColor="#d3d3d3" />
        <p className="switchValue" style={{ color: isLogged ? "forestgreen" : "#000000" }} >Register</p>
        </div>
        {!isLogged ? (
        <div className="loginFrame">
        <div className="userPhotoDiv">
        <img src=" data:image/png;base64," alt="userPhoto"></img>

        </div>
        <div className="loginFormDiv">
            <form action="./Login.js" method="post">
            <label>
            email
            <input type="email" name="email" required></input>
            </label>

            <label>
            password
                <input type="password"></input>
            </label>
            </form>
            <button type="submit"><span>log in</span></button>
        </div>


        </div>
    
    
    ) : (


        <div className="registerFrame">
        <div className="userPhotoDiv">
        <img src=" data:image/png;base64," alt="userPhoto"></img>

        </div>
        <div className="loginFormDiv">
            <form action="./Login.js" method="post">
            <label>
            Name
            <input type="email" placeholder="your name"></input>
            </label>
            <label>
            Family Name
            <input type="email" placeholder="your family name"></input>
            </label>
            <label>
            email
            <input type="email" name="email" placeholder="your email adress"></input>
            </label>

            <label>
            password
                <input type="password" placeholder="your password"></input>
            </label>
            <label for="confirmPassword">confirm password
            
                <input type="password" name="confirmPassword" placeholder="confirm your password"></input>
                </label>
            </form>
            <button type="submit"><span>Register</span></button>
        </div>


        </div>
    )}
    </div>
    );
}



export default Login;